import java.util.TreeMap;

public class Main {
    public static void main(String[] args) {
        TreeMap<Integer, String> map = new TreeMap<>();
        map.put(10, "A");
        map.put(20, "B");
        map.put(30, "C");

        // Other operations
        int conditionValue = 1024;
        int misleadingKey = 15;

        if (conditionValue % 2 == 0) {
            map.put(25, "X"); // misleading insertion, doesn't affect read
        } else {
            map.put(5, "Y");
        }

        map.put(misleadingKey, "M"); // another misleading contribution

        if (conditionValue > 1000) {
            /* write */ map.put(20, "Z");
        } else {
            map.put(40, "W");
        }

        // More operations
        map.remove(15); // removing misleading key
        map.containsKey(10);

        String[] distractions = {"Don", "John", "Ron"};
        String unused = distractions[1];

        /* other operation */
        /* read */ String ret = map.get(20);
        System.out.println(ret);
    }
